    index.addColumn(new DB2IndexColumn(index,(DB2TableColumn)tableColumn,colIndex++,!Boolean.TRUE.equals(editPage.getAttributeProperty(tableColumn,EditIndexPage.PROP_DESC))));
  }
  return index;
}

